  async getModelServiceDetailReq() {
    const { name, namespace } = this.getBaseInfo();
    try {
      const res = await this.utils.bff.getWorker({
        name,
        namespace,
      });
      const detail = res?.Worker?.getWorker || {};
      this.setState({
        detail,
      });
    } catch (err) {
      const description = err?.response?.errors?.[0]?.message || '未知错误';
      this.utils.notification.warn({
        message: '获取详情失败',
        description,
      });
    } finally {
      this.setState({
        loading: false,
      });
    }
  }

  async deleteModelServiceItemReq() {
    this.setState({
      okLoading: true,
    });
    const { name, namespace } = this.getBaseInfo();
    const input = {
      name,
      namespace,
    };
    try {
      const res = await this.utils.bff.deleteWorkers({
        input,
      });
      this.utils.notification.success({
        message: '删除成功',
      });
      this.setState(
        {
          delModalVisible: false,
        },
        () => {
          this.history.go(-1);
        }
      );
    } catch (err) {
      const description = err?.response?.errors?.[0]?.message || '未知错误';
      this.utils.notification.warn({
        message: '删除失败',
        description,
      });
    } finally {
      this.setState({
        okLoading: false,
      });
    }
  }

